@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {

}
<nav class="navbar navbar-expend-sm bg-dark navbar-dark">
      <ul class="navbar-ul" >
        <li class="nav-item">
            <a  routerLink="/"   class="nav-link active" >Principal</a>
        </li>
      </ul>
</nav>
